import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
let moment = require("moment");

// TODO
/*
  [] Validate one input
*/

const WorkoutForm = (props) => {
  const [type, setType] = useState("");
  const [date, setDate] = useState("");
  const [location, setLocation] = useState("");
  const [workoutLength, setWorkoutLength] = useState("");
  const [completed, setCompleted] = useState("");
  // const [errors, setErrors] = useState({});
  const [errorsObj, setErrorsObj] = useState({});
  const [inputFields, setInputFields] = useState([]);

  const navigate = useNavigate();

  const AddWorkoutInfo = async () => {
    let formField = new FormData();

    handleValidations();
    setErrors([]);

    formField.append("type", type);
    formField.append("date", moment(date).format("yyyy-MM-DD"));
    formField.append("location", location);
    formField.append("completed", completed);
    formField.append("workout_length", workoutLength);

    await axios({
      method: "post",
      url: "http://127.0.0.1:8000/api/",
      data: formField,
    })
      .then((response) => {
        console.log(response.data);
        alert("Successfully added workout!");
        navigate("/workouts");
      })
      .catch((err) => {
        const errorResponse = err.response.request.response;
        console.log(
          "ðŸš€ ~ file: WorkOutForm.jsx:48 ~ AddWorkoutInfo ~ errorResponse:",
          JSON.stringify(errorResponse)
        );
        // const errorResponse = err.response.data.errors;
        // const errorArr = [];
        // for (const key of Object.keys(errorResponse)) {
        //   errorArr.push(errorResponse[key].message);
        // }
        setErrors(errorResponse);
        // console.log(
        //   "ðŸš€ ~ file: WorkOutForm.jsx:53 ~ AddWorkoutInfo ~ errorArr:",
        //   errorArr
        // );
        // console.log(err.response.data);
      });
  };

  const handleValidations = () => {
    let errorsObj = {};
    if (!type.length || type.length < 2) {
      errorsObj["type"] = `Please enter a workout type.`;
    }

    if (date === "") {
      errorsObj["date"] = `Please select a date.`;
    }

    if (!workoutLength.length || workoutLength.length < 2) {
      errorsObj["workoutLength"] = `Please add workout length.`;
    }

    if (!location.length || location.length < 2) {
      errorsObj["location"] = `Please add workout location.`;
    }
  };

  return (
    <div className="container">
      {/* Workout Type */}
      <div className="form-group">
        <label for="workoutType">Type of Workout</label>
        <input
          required
          type="text"
          className="form-control"
          placeholder="What did you do today?"
          name="type"
          value={type}
          onChange={(e) => setType(e.target.value)}
        />
      </div>
      <span style={{ color: "red" }}>{errorsObj.type}</span>
      <br />

      {/* Date */}
      <div className="form-group">
        <label>Date:</label>
        <DatePicker
          closeOnScroll={true}
          selected={date}
          dateFormat="yyyy-MM-dd"
          onChange={(d) => setDate(d)}
        />
      </div>

      {/* Location */}
      <div className="form-group">
        <label for="location">Location</label>
        <input
          type="text"
          className="form-control"
          placeholder="Enter Location"
          name="location"
          value={location}
          onChange={(e) => setLocation(e.target.value)}
        />
      </div>

      {/* workout length */}
      <div className="form-group">
        <label for="location">Workout Length</label>
        <input
          type="text"
          className="form-control"
          placeholder="Enter Workout Length"
          name="workoutLength"
          value={workoutLength}
          onChange={(e) => setWorkoutLength(e.target.value)}
        />
      </div>

      {/* Dropdown Menu - Select Input */}
      <div className="form-group">
        <label> Smashed it? </label>
        <select
          value={completed}
          className="form-control"
          onChange={(e) => setCompleted(e.target.value)}
        >
          <option value="default">Select</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>
      </div>

      {/* Submit Button */}
      <button className="btn btn-success" onClick={AddWorkoutInfo}>
        Add Workout!
      </button>
      <h2>{errors}</h2>
    </div>
  );
};

export default WorkoutForm;
